import React from 'react';
import Slider from 'react-slick';

const HomePage = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <div className="home">
      <Slider {...settings}>
        <div>
          <img src="9.png" alt="slider image 1" />
        </div>
        <div>
          <img src="image2.jpg" alt="slider image 2" />
        </div>
        <div>
          <img src="image3.jpg" alt="slider image 3" />
        </div>
      </Slider>
      <h1>Welcome to our e-commerce site</h1>
      <p>We offer a wide variety of products at competitive prices.</p>
    </div>
  );
};

export default HomePage;
